public abstract class Employee {

    //Atributos

    private String nome;
    private String codeFuncionario;
    private double salarioBase;

    //Construtor

    public Funcionário(String nome, String codeFuncionario, double salarioBase) {
        this.nome = nome;
        this.codeFuncionario = codeFuncionario;
        this.salarioBase = salarioBase;
    }

    public String Nome() {
        return nome;
    }

    public String codeFuncionario() {
        return codeFuncionario;
    }

    public double salarioBase() {
        return salarioBase;
    }

    public String getNome() {
        return nome;
    }

    public String getCodeFuncionario() {
        return codeFuncionario;
    }

    public double getSalarioBase() {
        return salarioBase;
    }

    public abstract double calculaSalario();
}

}
